}
varying vec2 v_uv;
uniform sampler2D Texture1;
uniform sampler2D Texture2;
varying float factor_fog;
uniform float rate;
vec4 frag () {
  vec4 col = vec4(1, 1, 1, 1);
  vec4 t1 = col * texture2D(Texture1, v_uv);
  vec4 t2 = col * texture2D(Texture2, v_uv);
  vec4 r = vec4(1, 1, 1, 1);
  r.x = t2.x * rate;
  r.y = t2.y * rate;
  r.z = t2.z * rate;
  r.w = t2.w * rate;
  return CCFragOutput(mix(t1, t2, rate));
}
void main() { gl_FragColor = frag(); }
